import React from "react";
import Container from "../Container";
import "./style.css";

function UserCard(props) {
    return (
        <Container>
            <img className="pic" src={props.img} alt="profile picture"></img>
            <h3>{props.name}</h3>
            <p>{props.jobTitle}</p>
            <br></br>
            <a href={props.github}>Github</a>
        </Container>
    );
}

export default UserCard;
